function GroupTable(props) {
    const {id, group, countries, scores} = props;

    return (
        <table className="GroupTable">
            <tr><td>{group}</td><td className="FlagCell"></td><td className="FlagCell"></td><td className="FlagCell"></td><td className="FlagCell"></td></tr>
            <tr><td className="FlagCell"></td><td className="BlockedCell"></td><td></td><td></td><td></td></tr>
            <tr><td className="FlagCell"></td><td></td><td className="BlockedCell"></td><td></td><td></td></tr>
            <tr><td className="FlagCell"></td><td></td><td></td><td className="BlockedCell"></td><td></td></tr>
            <tr><td className="FlagCell"></td><td></td><td></td><td></td><td className="BlockedCell"></td></tr>
        </table>
    );
}

export default GroupTable;
